from itertools import product
class Solution:
    def hasAllCodes(self,s,k):
        if (k ** 2) + 1 < len(s):
            helping_array = []
            helping_array.extend(product(['0', '1'], repeat=k))
            for i in range(len(helping_array)):
                helping_array[i] = "".join(helping_array[i])
                if helping_array[i] not in s:
                    return False
            return True
        else:
            return False


